import React from 'react';

function changeTxt(setTxt,txt) {

  if(txt==='Soy el Primer Texto') {
    setTxt('ahora soy el segundo texto');

  } else {
    setTxt('Soy el Primer Texto')
  }


}

function Boton({setTxt,txt}) {



  return (
    <button onClick={() => {changeTxt(setTxt,txt)}}> Cambiar Texto </button>
  );
}

export default Boton;
